        sdetails: "bat me btauga",
        samount: 23,
        sdate: '12/21/22' 
    },
    {
        sname: "rajan",
        sdetails: "bat me btauga",
        samount: 23,
        sdate: '12/21/22' 
    },
    {
        sname: "mohit",
        sdetails: "bat me btauga",
        samount: 23,
        sdate: '12/21/22' 
    }
  ]

  let data = props.Ndata
  if (data.length!==0){
    Sdata.push(data)
  }

  // sdate ke sare obj aage eske under 
   const ecard = (val) => {
      return(
        // <div > unique key add akrni hai
          <Card 

              name={val.sname}
              details={val.sdetails}
              amount={val.samount}
              date={val.sdate}
          />
          // </div>
      )
  }


  return (
    <>
    {Sdata.map(ecard)}
    </>
  )
}

export default Cards
